    const { 
        body: { user }
    } = req;
    const jsonUser = JSON.parse(user);
    try {
        const loggedUser = await User.findOne({ email: jsonUser.email });
        res.render('home', { loggedUser });
    } catch (err) {
        console.log(err);
        res.redirect(routes.login);
    }
};

