// Global
const HOME = "/";
const JOIN = "/join";
const LOGIN = "/login";
const AUTH = "/authuser";
const LOGOUT = "/logout";
const SEARCH = "/search";
const PYTHON = "/python";

// Users
const USERS = "/users";
const CHANGE_PASSWORD = "/change-password";
const ME = "/me";
const ADD_KEY = "/addKey";
const DELETE_KEY = "/deleteKey";

// data
const DATAS = "/data";
const DATA_USER = "/:id";

// API
const API = "/api";
const WEATHER = "/weather";

const routes = {
    //Global
    home: HOME,
    join: JOIN,
    login: LOGIN,
    auth: AUTH,
    logout: LOGOUT,
    search: SEARCH,
    python: PYTHON,

    //Users
    users: USERS,
    changePassword: CHANGE_PASSWORD,
    me: ME,
    addKey: ADD_KEY,
    deleteKey: DELETE_KEY,

    //Datas
    data: DATAS,
    dataUser: id => {
        if (id) {
          return `data/${id}`;
        } else {
          return DATA_USER;
        }
    },
    // API
    api: API,
    weather: WEATHER
