import User from "../models/User";
import Product from "../models/Product";

// Global
export const postJoin = async (req, res) => {
    const { 
        name, 
        email, 
        password, 
        confirmPassword, 
        key 
    } = req.body;
    try {
        if(!name || !email || !password || !confirmPassword || !key) {
            return (
                res.json({ 
                    success: false,
                    message: "ëª¨ë“  ì •ë³´ë¥¼ ìž…ë ¥í•´ì£¼ì„¸ìš”ðŸ˜…" 
                })
            )
        }
        const existedUser = await User.findByEmail(email)
        const existedKey = await Product.findOne({ keyName: key });
        if(existedUser) {
            return (
                res.json({ 
                    success: false,
                    message: "ì´ë¯¸ ê°€ìž…ëœ ì´ë©”ì¼ìž…ë‹ˆë‹¤ðŸ˜…"
                })
            )
        }
        if(existedKey) {
            return (
                res.json({
                    success: false,
                    message: "ì´ë¯¸ ë“±ë¡ëœ í‚¤ìž…ë‹ˆë‹¤ðŸ˜…"
                })
            )
        }
        if(password !== confirmPassword) {
            return (
                res.json({ 
                    success: false,
                    message: "ë¹„ë°€ë²ˆí˜¸ê°€ ì¼ì¹˜í•˜ì§€ ì•ŠìŠµë‹ˆë‹¤ðŸ˜…"       
                })
            )
        }
        const user = await User.create({
            email,
            name
        });
        await user.setPassword(password);
        await user.save();
        const product = await Product.create({
            keyName: key,
            data: [],
            user: user.id
        });
        await product.save();
        user.keyList.push(product.id);
        user.save();
        res.json({ 
            success: true,
            message: "íšŒì›ê°€ìž…ì— ì„±ê³µí•˜ì…¨ìŠµë‹ˆë‹¤."
        })
    } catch(err) {
        throw Error();
    }
};

export const postLogin = async (req, res) => {
    const { email, password } = req.body;
    try {
        const user = await User.findByEmail(email);
        if(!email || !password) {
            res.json({ 
                success: false,
                message: "ì´ë©”ì¼ê³¼ ë¹„ë°€ë²ˆí˜¸ë¥¼ ìž…ë ¥í•´ì£¼ì„¸ìš”ðŸ˜…"
            });
            return;
        }
        if(!user) {
            res.json({ 
                success: false,
                message: "ì¡´ìž¬í•˜ì§€ ì•ŠëŠ” ì´ë©”ì¼ìž…ë‹ˆë‹¤ðŸ˜…"
            });
            return; 
        }
        const checkPassword = await user.checkPassword(password);
        if(!checkPassword) {
            res.json({ 
                success: false,
                message: "ë¹„ë°€ë²ˆí˜¸ë¥¼ í™•ì¸í•´ì£¼ì„¸ìš”ðŸ˜…"
            });
            return;
        }
        user.serialize();
        const token = await user.generateToken(user);
        user.save();
        res.cookie('access_token', token, {
            maxAge: 1000 * 60 * 60 * 24 * 7,
            httpOnly: true
        })
            .status(200)
            .json({ 
                success: true,
                userId: user.id    
            });
    } catch(err) {
        throw Error();
    };
};

export const auth = async(req, res) => {
    let keyInfos = [];
    const {
        user: {
            id,
            name,
            email,
            keyList: keyId
        }
    } = req;
    try {
        for(const key of keyId) {
            const keyInfo = await Product.findById(key);
            keyInfos.push(keyInfo);
        }
        return res.status(200)
            .json({
                id,
                name,
                email,
                keyList: keyInfos,
                isAuth: true
            });
    } catch(err) {
        return res.json({
            isAuth: false,
            error: err
        });
    }
};

export const logout = async (req, res) => {
    const {
        user: { _id: id }
    } = req;
    try {
        const user = await User.findByIdAndUpdate(id, {token: ""});
        user.save();
        res.cookie('access_token', "")
            .status(200)
            .json({ 
                success: true,
                isAuth: false
            });
    } catch(err) {
        res.json({ 
            success: false, 
            error: err
        });
    } 
};

